INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (110, 0, 0, 1, 101, 1, 122601, 1.5, 1, 0.029, 160, 105, 1, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。");
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (105, 0, 1, 0, 102, 3, 122401, 2.5, 2, 0.014, 120, 111, 2, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。");
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (110, 1, 0, 0, 103, 2, 122501, 2.5, 3, 0.017, 350, 105, 3, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。");
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (110, 0, 1, 0, 104, 3, 107501, 1.5, 4, 0.016, 130, 105, 4, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。");
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (110, 0, 0, 1, 105, 1, 107601, 2.5, 5, 0.014, 160, 105, 5, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。");
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (120, 1, 0, 0, 106, 2, 107801, 3.5, 6, 0.029, 255, 103, 6, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。");
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (120, 0, 0, 1, 107, 1, 110601, 3.5, 7, 0.013, 160, 103, 7, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。");
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (110, 1, 0, 0, 108, 2, 110401, 2.5, 8, 0.014, 350, 103, 8, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。");
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (105, 0, 1, 0, 109, 3, 110501, 1.5, 9, 0.012, 130, 100, 9, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。");
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (105, 0, 0, 1, 110, 1, 115701, 2.5, 10, 0.014, 200, 103, 10, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。");
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (105, 1, 0, 0, 111, 2, 113601, 2.5, 11, 0.071, 350, 103, 11, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。");
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (120, 0, 1, 0, 112, 3, 107901, 1.5, 12, 0.014, 130, 103, 12, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。");
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (110, 0, 0, 1, 113, 2, 108001, 1.5, 13, 0.022, 200, 105, 13, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。");
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (110, 0, 0, 1, 114, 1, 110301, 2.5, 14, 0.031, 160, 108, 14, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。");
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (110, 0, 1, 0, 115, 1, 107701, 0.5, 15, 0.036, 130, 105, 15, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。");
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (110, 1, 0, 0, 116, 2, 113101, 3.5, 16, 0.048, 350, 95, 16, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。");
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (105, 0, 1, 0, 117, 3, 113301, 1.5, 17, 0.043, 130, 105, 17, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。");
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (105, 0, 1, 0, 118, 2, 113201, 1.5, 18, 0.018, 130, 95, 18, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。");
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (110, 0, 0, 1, 119, 2, 117001, 2.5, 19, 0.021, 160, 108, 19, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。");
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (110, 1, 0, 0, 120, 1, 113501, 2.5, 20, 0.036, 255, 105, 20, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。");
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (105, 1, 0, 0, 121, 3, 113401, 2.5, 21, 0.02, 350, 105, 21, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。");
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (110, 0, 1, 0, 122, 1, 110101, 2.5, 22, 0.018, 130, 105, 22, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。");
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (105, 0, 0, 1, 123, 3, 110001, 3.5, 23, 0.03, 160, 111, 23, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。");
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (110, 0, 1, 0, 124, 1, 117201, 1.5, 24, 0.027, 130, 103, 24, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。");
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (105, 0, 0, 1, 125, 2, 117301, 3.5, 25, 0.02, 160, 108, 25, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。");
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (110, 1, 0, 0, 126, 3, 117401, 2.5, 26, 0.04, 350, 105, 26, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。");
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (110, 1, 0, 0, 127, 1, 117101, 3.5, 27, 0.009, 350, 105, 27, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。");
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (120, 1, 0, 0, 128, 1, 122901, 3.5, 28, 0.022, 255, 105, 28, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。");
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (110, 0, 1, 0, 129, 3, 122801, 2.5, 29, 0.028, 130, 105, 29, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？");
INSERT INTO `v1_13de4c3dc313949ab80cd285375a9f2fad386bdf06760b18eedd0429ef9ce42e` VALUES (105, 0, 0, 1, 130, 2, 122701, 3.5, 30, 0.023, 130, 108, 30, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。");
